import{_ as t,c as o,o as a,ah as r}from"./chunks/framework.PvdZnrZd.js";const u=JSON.parse('{"title":"Multivendor Marketplace Documentation","description":"Learn how to integrate your shopify store with webkul marketplace app shopify.","frontmatter":{"title":"Multivendor Marketplace Documentation","description":"Learn how to integrate your shopify store with webkul marketplace app shopify.","date":"2025-06-02T00:00:00.000Z","author":"Webkul Team"},"headers":[],"relativePath":"zenith/introduction/overview.md","filePath":"zenith/introduction/overview.md"}'),l={name:"zenith/introduction/overview.md"};function n(i,e,s,p,c,h){return a(),o("div",null,[...e[0]||(e[0]=[r('<p><a href="https://store.webkul.com/Shopify-Multi-Vendor-Marketplace.html" target="_blank" rel="noreferrer">Multivendor Marketplace App for Shopify</a> is here with a new theme now and it would be really exciting to learn about its functions for the Admin and the Seller.</p><p>This guide will help you to understand the new theme and its functionalities.</p><p>Multivendor Marketplace App is the ultimate tool to convert your store into a fully-functioning marketplace.</p><p>Here, multiple sellers can register who can sell their products locally or globally and the admin can charge a commission on each seller&#39;s earnings.</p><p>Firstly, let&#39;s see how to install the Multivendor App on the Shopify Store.</p><h3 id="video-guide-app-installation" tabindex="-1">Video Guide: App Installation <a class="header-anchor" href="#video-guide-app-installation" aria-label="Permalink to &quot;Video Guide: App Installation&quot;">​</a></h3><p>You can go through the <strong>Video Guide</strong> to understand how you can install the Multivendor app on your Shopify Store.</p><p><a href="https://youtu.be/b9lNPcAyZaU?si=9RFwWS0xSO_f2G5D" target="_blank" rel="noreferrer">Click Here to Watch The Video</a></p><h3 id="import-configurations-from-other-shopify-store" tabindex="-1">Import configurations from other Shopify store <a class="header-anchor" href="#import-configurations-from-other-shopify-store" aria-label="Permalink to &quot;Import configurations from other Shopify store&quot;">​</a></h3><p>While installing the multivendor marketplace app, you will get a store migration option in which</p><p>if you want that your previously installed multivendor marketplace app settings</p><p>on other Shopify store should be the same as in this newly installed multivendor marketplace app on the new Shopify store.</p><p>Then you can paste your previous Shopify store URL in the Store URL field and select the configuration menu</p><p>which settings should be the same in the newly installed multivendor marketplace app and click the next button.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2023/06/chatwhizz.png" alt="chatwhizz"></p><p>And after this, the admin will set the global commission and have the option set the Google Recaptcha for the seller sign up page.</p><p>Then the admin will be redirected to the Multivendor admin dashboard where the admin can click on the sync symbol to the status of the migration like shown below image.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2023/05/1-chat-s-.png" alt="1-chat-s-"></p><p><strong>Note:-</strong> This migration step will appear while installing the multivendor marketplace app and once you have skipped this then it wouldn&#39;t come again</p><p>Once you install the Multivendor app on your store you will be straightaway land to the home page of the Multivendor Marketplace app.</p><p><a href="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/08/dashboard-new-theme.webp" target="_blank" rel="noreferrer"><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/08/dashboard-new-theme.webp" alt="Home Page Multivendor Marketplace for Shopify by Webkul"></a></p><p>This is the view of the Home Page from where you can check all the recent updates of the app:</p><h3 id="new-theme-features" tabindex="-1">New Theme Features: <a class="header-anchor" href="#new-theme-features" aria-label="Permalink to &quot;New Theme Features:&quot;">​</a></h3><p>More interactive dashboard for the Admin and the Sellers both.* Translation made easy for all the labels in the app.</p><ul><li>Much more clear and systematic menus.</li><li>Admin can now modify the part of their existing(default) seller URL that appears before <strong>“.sp-seller.webkul.com”</strong> once, during the app installation and onboarding process.</li><li>The seller login password can be reset by Admin.</li><li>Admin can send &quot;Order fulfillment Reminders&quot; in bulk to the Sellers.</li><li>Moreover, he can send emails to the Sellers.</li><li>The Admin can now upload the default banners for all his sellers which will be visible on the Seller&#39;s profile page.</li><li>He can now change the header and footer background colour of the mail templates of the app.</li><li>The Admin can now create the subcategories of a particular collection for the product page with the help of our new feature name &quot;<a href="https://webkul.com/blog/shopify-multivendor-marketplace-multilevel-collection-setup/" target="_blank" rel="noreferrer">Multilevel collection</a>&quot;.</li><li>Admin can now add the staff members and assign permissions to them to manage the activities on the admin panel with the help of our new feature app named &quot;<a href="https://webkul.com/blog/shopify-multivendor-marketplace-feature-admin-staff/" target="_blank" rel="noreferrer">Admin staff&quot;</a>.</li><li>He can also allow his sellers to add the staff to manage the activities on the seller panel with the help of our new feature app &quot;<a href="https://webkul.com/blog/shopify-multivendor-marketplace-app-seller-staff/" target="_blank" rel="noreferrer">Seller Staff</a>&quot;.</li><li>Sellers can now disable their products or can sell their products (with a message display) for customers if in case he/she is not available to fulfill the orders with the help of &quot;<a href="https://webkul.com/blog/shopify-multivendor-marketplace-seller-vacation-app/" target="_blank" rel="noreferrer">Seller Vacation</a>&quot; feature app.</li><li>Both admin and Sellers can now add booking products on their end and allow more than one customer to book a slot at a time using the <a href="https://webkul.com/blog/shopify-multivendor-marketplace-booking-app-integration/" target="_blank" rel="noreferrer">Booking Product</a> feature app which is now integrated with <a href="https://webkul.com/blog/shopify-booking-app/" target="_blank" rel="noreferrer">Booking App for Shopify</a> by Webkul.</li><li>Now, Product Custom Fields are also exported in Order export CSV.</li></ul><h3 id="understanding-the-menus" tabindex="-1">Understanding the Menus <a class="header-anchor" href="#understanding-the-menus" aria-label="Permalink to &quot;Understanding the Menus&quot;">​</a></h3><p>The menu functions the same way but there are changes in the positioning:</p><h3 id="dashboard" tabindex="-1">Dashboard <a class="header-anchor" href="#dashboard" aria-label="Permalink to &quot;Dashboard&quot;">​</a></h3><p>The Admin dashboard is much more informative now. You can now check the Best Selling Product, Recent already RegisterSellers, Recent Order, etc., simply by looking at the dashboard.</p><p><a href="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/08/dashborad-newtheme-scaled.webp" target="_blank" rel="noreferrer"><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/08/dashborad-newtheme-scaled.webp" alt="Admin Dashboard Multivendor Marketplace for Shopify by Webkul"></a></p><h3 id="configuration" tabindex="-1">Configuration <a class="header-anchor" href="#configuration" aria-label="Permalink to &quot;Configuration&quot;">​</a></h3><p>With this, you can manage the Configuration of the App.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/08/configuration.webp" alt="dashboard"></p><h2 id="instruction-for-marketplace" tabindex="-1"><strong>Instruction for Marketplace</strong> <a class="header-anchor" href="#instruction-for-marketplace" aria-label="Permalink to &quot;**Instruction for Marketplace**&quot;">​</a></h2><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/08/instruction-1-scaled.webp" alt="Details Multivendor Marketplace for Shopify by Webkul"></p><p>This includes all the information, which was there in the &quot;configuration&quot; menu before, i.e., the old theme.</p><p>From here, the admin can view all the instructions provided for the configuration of the marketplace.</p><blockquote><p>In case you need help with adding the codes, feel free to connect via <strong><a href="mailto:support@webkul.com" target="_blank" rel="noreferrer">support@webkul.com</a></strong></p></blockquote><h2 id="general-configuration" tabindex="-1"><strong>General Configuration</strong> <a class="header-anchor" href="#general-configuration" aria-label="Permalink to &quot;**General Configuration**&quot;">​</a></h2><p>This includes information that relate to the Admin account.</p><p>From here, the admin can enter the business email, set the currency for the shop, choose the weight unit for products, and much more.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/08/general-configuration-scaled.webp" alt="General configuration Multivendor Marketplace for Shopify by Webkul"></p><p>To know about the <strong>Configuration Updates</strong>, Kindly refer: <a href="https://marketplace-doc.webkul.com/zenith/configuration/general-configration.html" target="_blank" rel="noreferrer">Click Here</a></p><h2 id="product-configuration" tabindex="-1"><strong>Product Configuration</strong> <a class="header-anchor" href="#product-configuration" aria-label="Permalink to &quot;**Product Configuration**&quot;">​</a></h2><p>All the Product related configurations can be done from this menu.</p><p>Here, you can provide an option to add/edit/delete the products to your sellers, you can enable the option to auto-approve your products, auto-enable the added products and much more.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/08/productconfig-scaled.webp" alt="product configuration Multivendor Marketplace for Shopify by Webkul"></p><p>To know about the <strong>Product Updates</strong>, please refer: <a href="https://marketplace-doc.webkul.com/zenith/configuration/product-configration.html" target="_blank" rel="noreferrer">Click Here</a></p><h2 id="seller-configuration" tabindex="-1"><strong>Seller Configuration</strong> <a class="header-anchor" href="#seller-configuration" aria-label="Permalink to &quot;**Seller Configuration**&quot;">​</a></h2><p>All the Seller-related configuration can be done from this menu.</p><p>From here, you can allow your sellers to fulfill items, enable the option to auto-approve the added sellers, allow sellers to view customers&#39; details and much more.</p><p><a href="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/08/sellerconfig-scaled.webp" target="_blank" rel="noreferrer"><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/08/sellerconfig-scaled.webp" alt=" seller configuration Multivendor Marketplace for Shopify by Webkul"></a></p><p>To know about the <strong>Seller Updates</strong>, Kindly refer: <a href="https://marketplace-doc.webkul.com/zenith/configuration/Seller-configuration.html" target="_blank" rel="noreferrer">Click Here/</a></p><h2 id="order-configuration" tabindex="-1"><strong>Order Configuration</strong> <a class="header-anchor" href="#order-configuration" aria-label="Permalink to &quot;**Order Configuration**&quot;">​</a></h2><p>All the configuration related to Orders can be done from here. You can make the &quot;Order Shipping method&quot; and &quot;Order Tracking number&quot; options mandatory.</p><p>Also, you can enable the &quot;Order Prepare Status&quot; option to track the order preparation by the sellers and much more.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/08/orderconfig-scaled.webp" alt="order configuration Multivendor Marketplace for Shopify by Webkul"></p><p>To know more about the <strong>Order-related Updates</strong>, Kindly refer: <a href="https://webkul.com/blog/shopify-multivendor-marketplace-app-new-upgraded-features/" target="_blank" rel="noreferrer">https://webkul.com/blog/shopify-multivendor-marketplace-app-new-upgraded-features/</a></p><h2 id="seller-payment-configuration" tabindex="-1"><strong>Seller Payment Configuration</strong> <a class="header-anchor" href="#seller-payment-configuration" aria-label="Permalink to &quot;**Seller Payment Configuration**&quot;">​</a></h2><p>Admin will set up the Payment Methods for his sellers from here and the same payment methods will be available at the seller&#39;s end.</p><p>You can also set the &quot;Shipping cost&quot; and &quot;Taxes&quot; the way you want to distribute these charges between you and your sellers.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/08/seller-payment.webp" alt="payment "></p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/08/sellerpayment-scaled.webp" alt="methods"></p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/08/sellerpaymentc-scaled.webp" alt="settings"></p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/08/sellerpaymentconfig-scaled.webp" alt="autopay"></p><p>Check the <strong>Complete Payment Flow</strong> of the Multi-vendor Marketplace App: <a href="https://marketplace-doc.webkul.com/zenith/payment/Seller-Payment.html" target="_blank" rel="noreferrer">Click Here</a></p><h2 id="restriction-configuration" tabindex="-1"><strong>Restriction Configuration</strong> <a class="header-anchor" href="#restriction-configuration" aria-label="Permalink to &quot;**Restriction Configuration**&quot;">​</a></h2><p>Also, you can restrict the Product Category, Total Order Commission &amp; Total Order Amount to be displayed on the dashboard.</p><p><a href="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/08/restrict-scaled.webp" target="_blank" rel="noreferrer"><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/08/restrict-scaled.webp" alt="Restriction configuration Multivendor Marketplace for Shopify by Webkul"></a></p><h2 id="custom-fields" tabindex="-1"><strong>Custom Fields</strong> <a class="header-anchor" href="#custom-fields" aria-label="Permalink to &quot;**Custom Fields**&quot;">​</a></h2><p>From here, the Admin can view all the custom fields added for sellers/products and can add a new custom field.</p><p>The main purpose of this is to have extra information either from the Seller or about the product being added by the Seller.</p><p><a href="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/08/customfield.webp" target="_blank" rel="noreferrer"><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/08/customfield.webp" alt="Custom Fields Multivendor Marketplace for Shopify by Webkul"></a></p><p>Know how to add custom fields in the app: <a href="https://webkul.com/blog/add-custom-fields-on-multi-vendor-marketplace-for-shopify/" target="_blank" rel="noreferrer">https://webkul.com/blog/add-custom-fields-on-multi-vendor-marketplace-for-shopify/</a></p><p>This was all about the App Configuration.</p><h2 id="sellers" tabindex="-1">Sellers <a class="header-anchor" href="#sellers" aria-label="Permalink to &quot;Sellers&quot;">​</a></h2><p><strong>Sellers:</strong></p><p>All the information related to the Sellers can be managed from this menu. It has the following submenus :</p><h3 id="video-guide-admin-adding-sellers" tabindex="-1">Video Guide: Admin Adding Sellers <a class="header-anchor" href="#video-guide-admin-adding-sellers" aria-label="Permalink to &quot;Video Guide: Admin Adding Sellers&quot;">​</a></h3><p>You can check the <strong>Video Guide</strong> to know how the admin can add sellers on the marketplace.</p><p><a href="https://www.youtube.com/watch?v=vdvnhMSFX7s" target="_blank" rel="noreferrer"><img src="https://img.youtube.com/vi/vdvnhMSFX7s/0.jpg" alt="Watch the video"></a></p><h2 id="seller-listing" tabindex="-1"><strong>Seller Listing</strong> <a class="header-anchor" href="#seller-listing" aria-label="Permalink to &quot;**Seller Listing**&quot;">​</a></h2><p>This will list all the Sellers that are registered with the Multivendor App. Admin can export the Seller Details. Admin can edit/disable the seller and can also add a new seller from this menu.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/08/sellerlisting.webp" alt="Adding Sellers Multivendor Marketplace for Shopify by Webkul"></p><h2 id="seller-form-settings" tabindex="-1"><strong>Seller Form Settings</strong> <a class="header-anchor" href="#seller-form-settings" aria-label="Permalink to &quot;**Seller Form Settings**&quot;">​</a></h2><p>Admin can manage the fields to be shown to the seller at the time of registration from here:</p><p><a href="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/12/sellerform.webp" target="_blank" rel="noreferrer"><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/12/sellerform.webp" alt="Sellers Multivendor Marketplace for Shopify by Webkul"></a></p><h2 id="shop-page-settings" tabindex="-1"><strong>Shop Page Settings</strong> <a class="header-anchor" href="#shop-page-settings" aria-label="Permalink to &quot;**Shop Page Settings**&quot;">​</a></h2><p>Admin can manage the labels for the sold by the link on a product page and also all the labels for the Seller Profile page :</p><p><a href="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/08/shoppagesettings-scaled.webp" target="_blank" rel="noreferrer"><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/08/shoppagesettings-scaled.webp" alt="Shop Page settings Multivendor Marketplace for Shopify by Webkul"></a></p><h2 id="seller-profile-page-settings" tabindex="-1"><strong>Seller Profile Page Settings</strong> <a class="header-anchor" href="#seller-profile-page-settings" aria-label="Permalink to &quot;**Seller Profile Page Settings**&quot;">​</a></h2><p>Admin can manage all the fields that are to be shown on the Seller Profile Page. Custom CSS can also be written to change the view of the Seller Profile Page at the Shopify end.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/08/sellerprofilepage-scaled.webp" alt="Seller profile page setting Multivendor Marketplace for Shopify by Webkul"></p><p>To <strong>know more</strong>, kindly refer to this User Guide: <a href="https://webkul.com/blog/shopify-multivendor-marktplace-custom-seller-profile-page-new-theme/" target="_blank" rel="noreferrer">https://webkul.com/blog/shopify-multivendor-marktplace-custom-seller-profile-page-new-theme/</a></p><h3 id="customize-seller-page" tabindex="-1">Customize Seller Page <a class="header-anchor" href="#customize-seller-page" aria-label="Permalink to &quot;Customize Seller Page&quot;">​</a></h3><p>From here, admin can manage the Seller Login Page fields, labels, logo and can also write its own JS and CSS for the page. The favicon icon upload option is provided here.</p><p><a href="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/08/customise-seller-page-scaled.webp" target="_blank" rel="noreferrer"><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/08/customise-seller-page-scaled.webp" alt="Customize seller page Multivendor Marketplace for Shopify by Webkul"></a></p><blockquote><p><strong>Custom CSS</strong> for seller dashboard option is now <strong>available</strong> in <strong>all the three plans</strong> (Basic, Executive, Pro) of the Multi-vendor Marketplace App.</p></blockquote><h2 id="feedback" tabindex="-1"><strong>Feedback</strong> <a class="header-anchor" href="#feedback" aria-label="Permalink to &quot;**Feedback**&quot;">​</a></h2><p>Here the admin can view the list of all the feedback&#39;s given by the customer from the Seller Profile Page and the same are managed from here :</p><p><a href="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/12/sellerfeedback.webp" target="_blank" rel="noreferrer"><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/12/sellerfeedback.webp" alt="Feedback Multivendor Marketplace for Shopify by Webkul"></a></p><h2 id="seller-policy" tabindex="-1"><strong>Seller Policy</strong> <a class="header-anchor" href="#seller-policy" aria-label="Permalink to &quot;**Seller Policy**&quot;">​</a></h2><p>From this menu, the Admin can customize the Seller Policy if &amp; only if, he has selected the seller policy to be &#39;Advance Seller Policy&#39; from the &#39;Seller Configuration&#39; section.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/12/sellerpolicy.webp" alt="Seller Policy Admin"></p><p>Know more about the <strong>advanced seller policy</strong>: <a href="https://webkul.com/blog/shopify-multivendor-marketplace-advance-seller-policy-new-theme/" target="_blank" rel="noreferrer">https://webkul.com/blog/shopify-multivendor-marketplace-advance-seller-policy-new-theme/</a></p><p>This was all about the Sellers part of the Admin end.</p><h2 id="products" tabindex="-1"><strong>Products</strong> <a class="header-anchor" href="#products" aria-label="Permalink to &quot;**Products**&quot;">​</a></h2><p>Admin can manage all the Products from this menu. You can add Product Tags, Product Types, Collections from this section.</p><p>Also, you can import your Shopify Store products into the app and assign products to sellers. You can customize the product&#39;s form from this section of the app.</p><p><a href="https://webkul.com/blog/multi-vendor-marketplace-for-shopify-insert-images-to-description-faqs/" target="_blank" rel="noreferrer">Multi-Vendor Marketplace for Shopify: Insert Images to Description &amp; FAQs</a></p><p>Screenshot lists the submenu:</p><p><a href="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/08/product.webp" target="_blank" rel="noreferrer"><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/08/product.webp" alt="Product listing Multivendor Marketplace for Shopify by Webkul"></a></p><h3 id="video-guide-products" tabindex="-1">Video Guide:Products <a class="header-anchor" href="#video-guide-products" aria-label="Permalink to &quot;Video Guide:Products&quot;">​</a></h3><p>Admin Adding Products Here is the <strong>Video Guide</strong> to know how the admin adds products on his end.</p><p><a href="https://youtu.be/FRBkcFDXHnc?si=aeur2eYoDvTwCeC5" target="_blank" rel="noreferrer">Click Here To Watch The Video</a></p><h2 id="product-listing" tabindex="-1"><strong>Product Listing</strong> <a class="header-anchor" href="#product-listing" aria-label="Permalink to &quot;**Product Listing**&quot;">​</a></h2><p>Admin can view the list of all the Products added by the Sellers and can manage them easily. He can export product details, add products by CSV, edit products in bulk and much more.</p><p><a href="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/08/productlisting.webp" target="_blank" rel="noreferrer"><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/08/productlisting.webp" alt="Add Product Multivendor Marketplace for Shopify by Webkul"></a></p><h2 id="product-tags" tabindex="-1"><strong>Product Tags</strong> <a class="header-anchor" href="#product-tags" aria-label="Permalink to &quot;**Product Tags**&quot;">​</a></h2><p>Admin can add the product tags from here and for this admin firstly needs to enable &quot;restrict the product tags&quot; button from the app under the &quot;restriction configuration&quot; menu.</p><p>Once done then the admin can add the tags.</p><p>By this seller cannot be able to add any new tags while creating the product and will have to use the tags which are already created by you.</p><p><a href="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/08/restricttag.webp" target="_blank" rel="noreferrer"><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/08/restricttag.webp" alt=" Restrict Tags Multivendor Marketplace for Shopify by Webkul"></a></p><p>Once done, save the changes.</p><p><a href="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/08/addtags.webp" target="_blank" rel="noreferrer"><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/08/addtags.webp" alt="Add tags Multivendor Marketplace for Shopify by Webkul"></a></p><p>A new tag added to the app :</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/08/edittags.webp" alt="Product Tags Multivendor Marketplace for Shopify by Webkul"></p><p>Please note:- The tags which are created by admin from the Shopify store cannot be synced in the multivendor marketplace app.</p><p>Admin needs to create new product tags from this section as shown in the above screenshots.</p><h2 id="product-types" tabindex="-1"><strong>Product Types</strong> <a class="header-anchor" href="#product-types" aria-label="Permalink to &quot;**Product Types**&quot;">​</a></h2><p>Admin can add product types from here and for this admin needs to enable &quot;restrict the product type&quot; section from the app under the &quot;restriction configuration&quot; menu.</p><p>Once done then the admin can add the type to the app.</p><p>By this seller cannot be able to add any new Product types while creating the product and will have to use the product types which are already created by you.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/08/restricttype.webp" alt=" Restrict Product Type Multivendor Marketplace for Shopify by Webkul"></p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/08/addtype.webp" alt="Add product Type Multivendor Marketplace for Shopify by Webkul"></p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/08/edittype.webp" alt="Edit Product Type Multivendor Marketplace for Shopify by Webkul"></p><h2 id="collections" tabindex="-1"><strong>Collections</strong> <a class="header-anchor" href="#collections" aria-label="Permalink to &quot;**Collections**&quot;">​</a></h2><p>You can have the collections sync from the Shopify store to the multivendor app. To do so, you need to enable, &quot;restrict collections&quot; from the configuration :</p><p><a href="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/08/restcoll.webp" target="_blank" rel="noreferrer"><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/08/restcoll.webp" alt="Restrict Collection Multivendor Marketplace for Shopify by Webkul"></a></p><p>Then from the collection submenu, sync the collections. This will list all your collections on the app.</p><p>You can also disable the collections and those will not be visible to the seller.</p><p><a href="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/08/addcoll.webp" target="_blank" rel="noreferrer"><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/08/addcoll.webp" alt="Add Collection Multivendor Marketplace for Shopify by Webkul"></a></p><p>Smart collections are synced this way:</p><p><a href="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/12/smartcollection.webp" target="_blank" rel="noreferrer"><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/12/smartcollection.webp" alt="Add Product Multivendor Marketplace for Shopify by Webkul"></a></p><p>To know more about <strong>Collection Sync</strong>, Please refer: <a href="https://marketplace-doc.webkul.com/zenith/products/Collection-sync.html" target="_blank" rel="noreferrer">https://marketplace-doc.webkul.com/zenith/products/Collection-sync.html</a></p><p>If you want the seller to view the smart collections then you can disable the &quot;restrict smart collection&quot; from the &quot;Restrict Configuration&quot;</p><h2 id="import-products" tabindex="-1"><strong>Import  Products</strong> <a class="header-anchor" href="#import-products" aria-label="Permalink to &quot;**Import  Products**&quot;">​</a></h2><p>If you have products added to the Shopify Store and now you want to assign them to the sellers, then you can use this option to import products into the app.</p><p>Firstly admin needs to click on &quot;import products&quot; section to import the products from Shopify store into a multivendor marketplace</p><p><a href="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/09/import.webp" target="_blank" rel="noreferrer"><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/09/import.webp" alt="Import Product Multivendor Marketplace for Shopify by Webkul"></a></p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/09/importproduct.webp" alt="Import Now Multivendor Marketplace for Shopify by Webkul"></p><p>Now make sure to assign these imported products to your sellers because only then the imported products will start showing on the &quot;Products Listing&#39; section of the Multivendor app.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/09/assign.webp" alt="Assign Products Multivendor Marketplace for Shopify by Webkul"></p><p>This way you can successfully import the products from your Shopify store into a multivendor marketplace app.</p><p><strong>Import Products from Shopify to the App</strong> know more: <a href="https://marketplace-doc.webkul.com/zenith/products/Import-products.html" target="_blank" rel="noreferrer">/zenith//products/Import-products.html</a></p><p><strong>Product Form Customization</strong> With this Admin can manage the &quot;Add Product Form&quot; for normal as well as digital products in the app.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/12/productform.webp" alt="Product Form Customization Multivendor Marketplace for Shopify by Webkul"></p><p><strong>Batch CSVs</strong> This section will have the list of all the CSVs you have upload on your store till now. They can be the product, seller or any other CSV file.* It can be approved/disapproved &amp; deleted by the Admin.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/12/batchcsv.webp" alt="Batch CSVs Admin"></p><p>This way you can manage the &quot;Product&quot; menu in the App.</p><h2 id="orders" tabindex="-1"><strong>Orders</strong> <a class="header-anchor" href="#orders" aria-label="Permalink to &quot;**Orders**&quot;">​</a></h2><p>Admin can see the orders from here, manage the invoice and can send the Reminder to the sellers for order fulfillment.</p><p><a href="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/12/order.webp" target="_blank" rel="noreferrer"><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/12/order.webp" alt="Order Listing Multivendor Marketplace for Shopify by Webkul"></a></p><h2 id="order-listing" tabindex="-1"><strong>Order listing</strong> <a class="header-anchor" href="#order-listing" aria-label="Permalink to &quot;**Order listing**&quot;">​</a></h2><p>All the orders are listed and admin can send fulfill reminders to the sellers.</p><p>Admin can export order details in the CSV file from the Multi-vendor app.<br><strong>NOTE</strong>:- From now onward, both <strong>product properties</strong>, as well as <strong>shipping label</strong>, is also supported in the order export CSV.</p><h3 id="video-guide-order-process" tabindex="-1">Video Guide: Order Process <a class="header-anchor" href="#video-guide-order-process" aria-label="Permalink to &quot;Video Guide: Order Process&quot;">​</a></h3><p>You can go through the <strong>Video Guide</strong> to know the complete order process on the admin side.</p><p><a href="https://youtu.be/F8HdGwXsejw?si=DCZX6Lv6FlU_kAKM" target="_blank" rel="noreferrer">Click Here to watch the video</a></p><h2 id="rma-configuration" tabindex="-1"><strong>RMA Configuration</strong> <a class="header-anchor" href="#rma-configuration" aria-label="Permalink to &quot;**RMA Configuration**&quot;">​</a></h2><p>Admin can manage the status used in Return request initiation for the seller products.</p><p><a href="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/12/rmalist.webp" target="_blank" rel="noreferrer"><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/12/rmalist.webp" alt="Add RMA Multivendor Marketplace for Shopify by Webkul"></a></p><p>Admin can raise the RMA request from the &quot;orders Listing&quot; section of the app and the same will be visible at seller end</p><p>and by this seller will get the information about the order in case of cancellation/exchange/return.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/12/raiserma.webp" alt="r2"></p><p>Once you click on the Raise RMA Request button, a new window will open, where you can initiate the RMA request, you can also mark the comment/ reasons for the RMA.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/12/raiserequest.webp" alt="unnamed-file"></p><h2 id="invoice-configuration" tabindex="-1"><strong>Invoice Configuration</strong> <a class="header-anchor" href="#invoice-configuration" aria-label="Permalink to &quot;**Invoice Configuration**&quot;">​</a></h2><p>Admin can configure the details of the invoice sent to the sellers from here. Also, allow the sellers to generate &amp; print invoice once generated by the admin.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/12/invoice-scaled.webp" alt="Invoice Configuration"></p><h2 id="invoice-template" tabindex="-1"><strong>Invoice template</strong> <a class="header-anchor" href="#invoice-template" aria-label="Permalink to &quot;**Invoice template**&quot;">​</a></h2><p>Admin can manage and edit the content of the invoice sent from <strong>&quot;Admin to seller&quot;</strong>, the invoice sent from <strong>&quot;seller to the customer&quot;</strong> and also <strong>&quot;seller bulk invoice&quot;</strong>.</p><p>The menu helps in managing the invoice layout.</p><p><a href="https://webkul.com/blog/shopify-multi-vendor-marketplace/" target="_blank" rel="noreferrer"><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2017/11/15085011/Screenshot-2.png" alt="invoice template"></a></p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2017/11/15085107/AwesomeScreenshot-Invoice-Template-Admin-2019-07-15-10-07-13.png" alt="Invoice Template "></p><p>To know about the &quot;INVOICE&quot; feature in detail <a href="https://webkul.com/blog/shopify-multivendor-marketplace-invoice-feature-new-theme/" target="_blank" rel="noreferrer">Click here.</a></p><p>Know More about <strong>Invoice</strong>: <a href="https://webkul.com/blog/shopify-multivendor-marketplace-invoice-feature-new-theme/" target="_blank" rel="noreferrer">https://webkul.com/blog/shopify-multivendor-marketplace-invoice-feature-new-theme/</a></p><p>That&#39;s all about the Order Management menu in the app</p><h3 id="commission" tabindex="-1">Commission <a class="header-anchor" href="#commission" aria-label="Permalink to &quot;Commission&quot;">​</a></h3><p>In the Multivendor Marketplace App, Commission is the share of the admin in each seller&#39;s earning.</p><p>From this section of the app, admin can set global commission, seller-wise commission and category-wise commission.</p><p><a href="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/12/commissiontypes.webp" target="_blank" rel="noreferrer"><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/12/commissiontypes.webp" alt="Commission Listing Multivendor Marketplace for Shopify by Webkul"></a></p><p>The menu consists of :</p><p><strong>Commission Listing</strong> The menu will list all commissions earned by the Admin for each order.* <strong>Global Commission Settings:</strong> Admin can set commission for all Sellers and for all the Products applied to all Collections.</p><p><a href="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/12/globalcommission.webp" target="_blank" rel="noreferrer"><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/12/globalcommission.webp" alt="Global Commission Multivendor Marketplace for Shopify by Webkul"></a></p><p>Admin can specify the type of the commission and then specify the amount for the same.</p><h2 id="seller-commission-settings" tabindex="-1"><strong>Seller Commission Settings</strong> <a class="header-anchor" href="#seller-commission-settings" aria-label="Permalink to &quot;**Seller Commission Settings**&quot;">​</a></h2><p>Admin can also set  Commission for each seller from this menu.</p><p><a href="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/12/sellercommission.webp" target="_blank" rel="noreferrer"><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/12/sellercommission.webp" alt="Add commission to sellers Multivendor Marketplace for Shopify by Webkul"></a></p><p><a href="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/12/addsellercommission.webp" target="_blank" rel="noreferrer"><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/12/addsellercommission.webp" alt="Seller commission amount Multivendor Marketplace for Shopify by Webkul"></a></p><p>This is how the Admin can set up a commission for each seller.</p><p>Please note that in case there is no seller commission then the global commission will be applicable to the seller.</p><h2 id="collection-commission-settings" tabindex="-1"><strong>Collection Commission Settings</strong> <a class="header-anchor" href="#collection-commission-settings" aria-label="Permalink to &quot;**Collection Commission Settings**&quot;">​</a></h2><p>Admin can also have a commission based on the Collections. See how :</p><p><a href="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/12/catogerycommission.webp" target="_blank" rel="noreferrer"><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/12/catogerycommission.webp" alt="Category commission Multivendor Marketplace for Shopify by Webkul"></a></p><p><a href="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/12/addcatogerycommission.webp" target="_blank" rel="noreferrer"><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/12/addcatogerycommission.webp" alt="Add Category commission Multivendor Marketplace for Shopify by Webkul"></a></p><p>After setting this admin can have the commission based on specific collection/category.</p><p>Please note that it&#39;s applicable only to manual collections not on automated or smart collection.</p><p>You can also refer to the user manual of the commission to know about commissions in detail. <a href="https://webkul.com/blog/shopify-multivendor-marketplace-commission-type-new-theme/" target="_blank" rel="noreferrer"><strong>Click here</strong></a></p><h3 id="video-guide-commissions" tabindex="-1">Video Guide: Commissions <a class="header-anchor" href="#video-guide-commissions" aria-label="Permalink to &quot;Video Guide: Commissions&quot;">​</a></h3><p>Here is the <strong>video guide</strong> to know how to set commissions in a much better way.</p><p><a href="https://youtu.be/TjXDS7dG3jA?si=yueFblkV5lCmrmv6" target="_blank" rel="noreferrer">Click Here To Know More About Commission</a></p><h3 id="payments" tabindex="-1">Payments <a class="header-anchor" href="#payments" aria-label="Permalink to &quot;Payments&quot;">​</a></h3><p>Admin can manage the payments from the menu. Admin can view all the Payment received from the Seller Orders and can view the Payment Methods selected by the Sellers.</p><p>Four sub-menu :</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/12/payment.webp" alt="payment"></p><h2 id="seller-payments" tabindex="-1"><strong>Seller Payments</strong> <a class="header-anchor" href="#seller-payments" aria-label="Permalink to &quot;**Seller Payments**&quot;">​</a></h2><p>To proceed, the admin first needs to select the seller payment type based on how they wish to pay the seller.</p><p>They can either choose to pay the total amount at once or, alternatively, opt for an order-wise payment method.</p><p>The selected option will, <strong>ultimately</strong>, determine how and when the seller receives their earnings.</p><p><strong>Seller Payment Type:</strong></p><p>You will now have the option to pay the sellers <strong>the whole amount of all the orders together</strong> or <strong>pay for individual orders separately</strong>.</p><p>Go to the <strong>Multivendor Marketplace app</strong> &gt;&gt;<strong>Payment</strong> &gt;&gt; <strong>Seller Payment Configuration</strong> &gt;&gt; Payment Setting &gt;&gt; Seller Payment Type &gt;&gt; Select the option and save</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/09/pay5.webp" alt="payment"></p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/09/pay6.webp" alt="payment"></p><h3 id="pay-the-total-amount" tabindex="-1">Pay the total Amount <a class="header-anchor" href="#pay-the-total-amount" aria-label="Permalink to &quot;Pay the total Amount&quot;">​</a></h3><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/09/pay7.webp" alt="payment"></p><p>Now, to pay to sellers, the admin needs to visit the “Seller Payments” section under the “payment” menu in the admin panel of the multivendor marketplace app</p><p>The system will display a list of sellers on the redirected page. The admin can select the seller they wish to pay by clicking the &#39;View&#39; button available under the three-dot menu.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/09/pay8.webp" alt="pay 8"></p><p>After this, the admin needs to click on the ‘Pay’ button, which will redirect them to the Seller Payment Details page.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/09/pay9.webp" alt="pay 9"></p><p>Here, the admin can first select the date range to fetch the seller&#39;s orders.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/09/pay10.webp" alt="pay10"></p><p>Then, after reviewing the list, they can manually choose the specific orders they want to pay for. Additionally, this step-by-step process ensures more control and flexibility over payments.</p><p>By default, the system automatically selects all transactions; <strong>however</strong>, the admin can <strong>further</strong> review the list and <strong>if necessary</strong>, modify the selection to better suit their specific payout preferences.</p><p><strong>In addition</strong>, this flexibility allows for more accurate and customized payment handling.</p><p>After selecting the desired orders, the admin clicks on the ‘Pay’ button again.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/09/pay11.webp" alt="pay11"></p><p>A pop-up will appear, allowing the admin to choose a payment method and proceed to pay the seller.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/09/pay12.webp" alt="pay12"></p><p>The Payment page displays the selected orders&#39; earnings and the unsettled amount.</p><p><strong>Unsettled Amount:</strong> During the payment process, the admin pays the seller.</p><p>Meanwhile, we also display the ‘Unsettled Amount’ to provide a clear breakdown of pending charges.</p><p>This unsettled amount includes any refunded amounts or shipping label costs borne by the admin/seller. The system automatically handles these adjustments at the time of payment.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/09/pay13.webp" alt="Seller Payments"></p><h2 id="seller-payment-method" tabindex="-1"><strong>Seller Payment Method</strong> <a class="header-anchor" href="#seller-payment-method" aria-label="Permalink to &quot;**Seller Payment Method**&quot;">​</a></h2><p>Firstly, the admin needs to set up the payment methods for payments to the sellers from the admin panel of the app.</p><p>Admin end of Multivendor Marketplace app &gt;&gt; Payment &gt;&gt; Payment Method &gt;&gt; Enable the payment methods from here &gt;&gt; Save</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/12/payment-1.webp" alt="payment"></p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/09/pays.webp" alt="Seller Payments"></p><p>Now, the same payment methods will be available at the seller&#39;s end. The seller chooses the payment methods through which they want the admin to pay them.</p><p>Seller end of Multivendor Marketplace app-&gt;&gt; Profile-&gt;&gt; Payment details-&gt;&gt; Here choose any payment method from drop-down menu-&gt;&gt; Save</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/09/payt.webp" alt="payment"></p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/09/payfr.webp" alt="payment"></p><p>The admin can edit or change the payment methods that the sellers add from their respective panels.</p><h3 id="mail-settings" tabindex="-1">Mail Settings <a class="header-anchor" href="#mail-settings" aria-label="Permalink to &quot;Mail Settings&quot;">​</a></h3><p>Admin can configure all the emails sent to the Sellers/Customers from the App.</p><p>Moreover, the admin can set the header and footer background color of the mail templates from here.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/12/mailtemplate-scaled.webp" alt="image"></p><p>This way admin can configure the emails easily.</p><p>Now, You can also edit the table content of the Order Placed Mail templates as shown below:</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/12/editordermail-scaled.webp" alt="image"></p><h2 id="mail-settings-1" tabindex="-1"><strong>Mail</strong> Settings <a class="header-anchor" href="#mail-settings-1" aria-label="Permalink to &quot;**Mail** Settings&quot;">​</a></h2><p>Admin can now have your own email in the “from” and “reply-to” section of the email sent to the sellers/vendors for the order notification, product approval, etc.</p><p>Refer to the <a href="https://webkul.com/blog/shopify-multivendor-marketplace-smtp-configuration/" target="_blank" rel="noreferrer">user guide</a> for the same.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/12/mailsmtp-scaled.webp" alt="image"></p><p>To know More, Please refer: <a href="https://webkul.com/blog/shopify-multivendor-marketplace-app-smtp-configuration/" target="_blank" rel="noreferrer">https://webkul.com/blog/shopify-multivendor-marketplace-app-smtp-configuration/</a></p><h2 id="mail-counter" tabindex="-1"><strong>Mail Counter</strong> <a class="header-anchor" href="#mail-counter" aria-label="Permalink to &quot;**Mail Counter**&quot;">​</a></h2><p>This section will display you the mail details as shown in the image below:</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/12/mailcounter.webp" alt="image"></p><h3 id="translation" tabindex="-1">Translation <a class="header-anchor" href="#translation" aria-label="Permalink to &quot;Translation&quot;">​</a></h3><p>With the &quot;Translation&quot; menu, you can change the language for all the labels at the seller end, for all the menus.</p><p>So, now you can get the labels changed as per your own requirement and in your choice of language.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/12/translation.webp" alt="Translate Labels Multivendor Marketplace for Shopify by Webkul"></p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/12/edittranslation.webp" alt="Label Translation Multivendor Marketplace for Shopify by Webkul"></p><p>Now, translating labels are easier with the help of CSV. Export label CSV of the particular page, edit and save the CSV and then import the same to see the changes.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/12/export-1.webp" alt="Import/Export Labels Multivendor Marketplace for Shopify by Webkul"></p>',278)])])}const m=t(l,[["render",n]]);export{u as __pageData,m as default};
